package com.tns.ifet.day2;

/**
 * 
 */
public class ContinueDemo {

	/**
	 * 
	 */
	public ContinueDemo() {
		// TODO Auto-generated constructor stub
	}

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i = 5; i < 10; i++) {
			if (i == 5)
			continue;
			System.out.println(i);
		}
	}
}
